Create user database to store:
First, Last, Email, Username (pk) & Hashed Password

Create PHP functions:

addUser($first, $last, $email, $user, $hashedpass) {
-Check if username is unique
-Write new user to database
Return success or error (username already used)
}
checkPassword($user, $hashedpass) {
- Check if username & password are valid
Return true or false
}

